import './form.css'
import React from 'react'

class LoginForm extends React.Component{
    render(){
        return(
            <>
                <form action="">
                    <label htmlFor="fullname">Full Name</label>
                    <input type="test" name="fullname" id="fullname"/>
                </form>
            </>
        )
    }

}
export default LoginForm
